const lotsOfScribdLogo = Array.from({length: 857}, () => (
  {title: "Chinchilla Secrets: 100 Facts To Know and Tell about your Chinchilla",
   author: "Jessica Harrison",
   image_url: "https://imgv2-1-f.scribdassets.com/img/document/38880370/149x198/499a77aa62/0?v=1",
   scribd_url: "https://www.scribd.com/document/38880370"})
);
morningSearchResults['scribd-logo'] = lotsOfScribdLogo;
nightSearchResults['scribd-logo'] = lotsOfScribdLogo;

const SQSZ = 128 // this square size is everywhere

const unclampAndTranspose201 = (bhwc, bchw) => {
  // 8-bit bhwc canvas ImageData -> float32 bchw
  for(let c=0;c<=2;c++) {
    for(let h=0;h<SQSZ;h++) {
      for(let w=0;w<SQSZ;w++) {
        bchw[c*SQSZ*SQSZ + h*SQSZ + w] = bhwc[4 * (h * SQSZ + w) + c] / 255.0
      }
    }
  }
}

const videoConstraints = {
  width: SQSZ,
  height: SQSZ,
}

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      inference_result: vocab.map(() => 0),
      timing: "",
      bchw: Float32Array.from({length: SQSZ * SQSZ * 3}),
      facingMode: "environment",
      inferenceToggle: true,
      nightmode: false,
      viewinference: true,
    };
    this.webcamref = React.createRef();
  }
  componentDidMount() {
    this.handleWebcam();
    this.handleOnnx();
  }
  async handleOnnx() {
    const ortsession = await ort.InferenceSession.create('./landmarks-eight-categories.onnx', {executionProviders: ['wasm']});
    this.setState({ ortsession })
  }
  handleWebcam() {
    if(this.webcamref && this.webcamref.current && this.webcamref.current.getCanvas) {
      const canvas = this.webcamref.current.getCanvas();
      if (canvas !== null && this.state.ortsession !== undefined) {
        const ctx = canvas.getContext("2d");
        if (ctx !== null) {
          const imagedata = ctx.getImageData(0, 0, SQSZ, SQSZ).data;
          this.ingestPicture(imagedata);
        } else {
          console.log("no 2d context lol");
          requestAnimationFrame(() => this.handleWebcam());
        }
      } else {
        this.setState({timing: `canvas ${canvas !== null} session ${this.state.ortsession !== undefined}`});
        requestAnimationFrame(() => this.handleWebcam());
      }
    }
  }
  async ingestPicture(imagedata) {
    const {inferenceToggle} = this.state;
    if(inferenceToggle) {
      const startDate = Date.now();
      const {bchw, ortsession} = this.state;
      unclampAndTranspose201(imagedata, bchw);
      const input = new ort.Tensor("float32", bchw, [1, 3, SQSZ, SQSZ]);
      const {output} = await ortsession.run({input});
      const inference_result = output.data;
      const inferDate = Date.now();
      const timing = `${inferDate - startDate}`;
      this.setState({inference_result, timing});
    }
    requestAnimationFrame(() => this.handleWebcam());
  }
  render() {
    // if(!this.state || !this.state.session) return "";
    const top_k = 5;
    const {inference_result, timing, nightmode, inferenceoverride, viewinference} = this.state;
    const top_k_probs = new Float32Array([...inference_result]).sort().reverse().slice(0, top_k);
    const top_k_ids = top_k_probs.map(prob => inference_result.indexOf(prob));
    const top_search_result_string = inferenceoverride || vocab[top_k_ids[0]];
    const search_result = (nightmode ? nightSearchResults : morningSearchResults)[top_search_result_string];
    const filtered_search_result = search_result.filter(e => e.title.match(/^The Final Leap/) === null); // filter anything objectively harmful for a demo
    return <div className={"App" + (nightmode ? " nightmode" : "") + (viewinference ? "" : " noinference")}>
      <div className="logo"></div><div onClick={e => {this.setState({viewinference: !viewinference}) ; console.log({viewinference})} } className="top">BRYANT<br/>STREET<br/>IMAGING</div>
      <div className="camerapicker">
        <select id="facingMode" onChange={e => this.setState({facingMode: e.target.value})} value={this.state.facingMode}>
          <option value="user">selfie</option>
          <option value="environment">photo</option>
          <option value=""></option>
        </select>
        <br/><button onClick={e => {this.setState({nightmode: !nightmode})}}>change to {nightmode ? "day" : "night"}</button>
        <br/>
        <select id="inferenceoverride" onChange={e => this.setState({inferenceoverride: e.target.value})} value={inferenceoverride}>
          {
            vocab.map(s => <option value={s}>{s}</option> )
          }
        </select>
      </div>
      <Webcam
        audio={false}
        height={videoConstraints.height}
        width={videoConstraints.width}
        ref={this.webcamref}
        videoConstraints={{...videoConstraints, facingMode: this.state.facingMode}}
      />
      <center>
        <div className="inferenceToggle-container" onClick={() => this.setState({inferenceToggle: !this.state.inferenceToggle, inferenceoverride: null})}>
          <span className="inferenceToggle sans">
            {(this.state && this.state.inferenceToggle) ? "Browse" : "Keep Looking"}
          </span> 
        </div>
        <div className="inference-container">
          {
            [...Array(top_k).keys()].map(
              i => <div>{top_k_probs[i].toFixed(4)} @ {vocab[top_k_ids[i]]}</div>
            )
          }
        </div>
      </center>
      <div className="millis">
        {timing} ms: {this.state.ortsession === undefined ? " --- no session :(" : ""}
        {JSON.stringify(top_k_probs.map(p => Math.floor(p * 10000)))}
        {JSON.stringify(top_k_ids)}
      </div>
      <div className='carousel'>
        {filtered_search_result.map(
          (e,i) => <a className='carouselitem' href={e.scribd_url} target="_blank">
            <img className='thumb' src={e.image_url} />
            <div className='title sans jumbo'>{e.title}</div>
            <div className='author sans'>{e.author}&nbsp;</div>
          </a>
        )}
      </div>
    </div>
  }
}

export default App;
